Vakatekivu Chapter 24 Sa qase mai o Eparaama ka sa levu sara na nona veiyabaki. o Jiova talega sa vakalouvinakataki Eparaama ena ka kecega. 2 Sa tukuna o Eparaama vua na nona dauveiqaravi qase duadua – o koya sa lewa na nona veika kecega, "Daramaka mada mai na ligamu ena ruku ni sagaqu, 3 "Me'u cakava vei iko, mo bubului vei Jiova, na Kalou ni lomalagi kei na Kalou ni vuravura, o ya, mo kua ni taura mai e dua na yalewa ni vanua oqo o Kenani, me watina na luvequ; 4 "Mo lako ga ki noqu vanua, vei 
..........
na mada e liu na ka au mai cakava." Sa sauma mai o Lepani, "Mo vosa sara." 34 Sa tukuna mai, "Oi au na tamata dauveiqaravi nei Eparaama. 35 "O Jiova sa vakalouvinakataki koya vakalevu sara, ka sa tamata qaqa sara; na Kalou sa solia vua na manumanu, na siliva, na koula, na tagane kei na yalewa dauveiqaravi, na kameli kei na asa e levu sara. 36 "O Sera na watina na noqu turaga, sa vakasucuma e dua na gone tagane vua na noqu turaga ni sa qase sara; sa solia vua na luvena tagane oqo na veika kecega;

E cala ke da saga meda veitaratara kei ira na mate? “Dou kakua ni golevi ira sa daucurumi, . . . mo dou vakadukadukalitaki kina.”—Vunau ni Soro 19:31. KA ERA TUKUNA ESO E levu era via kila se ra rarawa tiko na wekadra lomani sa takali se sega. Era kaya kina: “Vakacava mo kerea e dua na dauvakacuru se daurairai me veitaratara kei na wekamu sa takali? De dua o na lomavakacegu kina.” KA E KAYA NA IVOLATABU E matata na ka e tukuna na iVolatabu me baleti ira era saga mera veitaratara kei ira na mate,
..........
] sa . . . yali.” (Dauvunau 9:5, 6) Io na iVolatabu e kaya ni o ira na mate era sega ni vakila e dua na ka. Era sega ni vakasama, yavala se qarava na Kalou. E kaya na Same 115:17, “era sa sega ni vakavinavinaka rawa vei Jiova ko ira na mate, se ko ira era lako sobu ki na vanua era galu kina.” E dau donu beka ena so na gauna na ka era vakatakila na dauvakacuru? “Me ra [tarogi, NW] na mate e na vukudra na bula?”—Aisea 8:19. KA ERA TUKUNA ESO O ira na dauvakacuru e rawa nira vakatakila na veika era
